import { registerThemeProperties } from "@ui5/webcomponents-base/dist/asset-registries/Themes.js";

import defaultThemeBase from "@ui5/webcomponents-theme-base/dist/generated/themes/sap_fiori_3/parameters-bundle.css.js";
import defaultTheme from "./sap_fiori_3/parameters-bundle.css.js";

registerThemeProperties("@ui5/webcomponents-theme-base", "sap_fiori_3", defaultThemeBase);
registerThemeProperties("@ui5/webcomponents", "sap_fiori_3", defaultTheme);
export default ".ui5-timepicker-sliders-container{display:flex;justify-content:center;align-items:stretch;direction:ltr;padding:.5rem;min-width:18rem;box-sizing:border-box}.ui5-timepicker-sliders-container.ui5-phone{height:90vh}.ui5-timepicker-footer{height:fit-content;display:flex;justify-content:flex-end;width:100%}.ui5-timepicker-wheelslider{padding-left:.25rem;padding-right:.25rem}.ui5-timepicker-footer>ui5-button{margin:1%;width:20%}";
